header {
  z-index: 1;
  background-color: #372e4c;
  box-shadow: 0 0.5rem 2rem 0 rgba(0, 0, 0, 0.37);
  justify-content: space-between;
  display: flex;
  flex-direction: row;
  flex-wrap: wrap;
  width: 100%;
  padding: 0 1rem;
  box-sizing: border-box;
}
@media (min-width: 768px) {
  header {
    padding: 0 1.5rem;
    align-items: end;
    position: sticky;
    top: 0;
  }
}
@media (min-width: 1280px) {
  header {
    flex-direction: row;
    padding: 0 2rem;
  }
}

ul .li-spaced, ol .li-spaced {
  margin-bottom: 1rem;
  margin-top: 1rem;
}
ul p, ul ul, ul ol, ol p, ol ul, ol ol {
  margin: 0;
}

main {
  margin: 0 auto;
  padding: 0 1rem;
}
@media (min-width: 768px) {
  main {
    padding: 0 1.5rem;
  }
}
@media (min-width: 1280px) {
  main {
    padding: 0 2rem;
  }
}

.nav {
  width: 100%;
  display: none;
}
@media (min-width: 768px) {
  .nav {
    display: contents;
  }
}
.nav--mobile {
  display: flex;
  justify-content: center;
  width: 100%;
}
@media (min-width: 768px) {
  .nav--mobile {
    display: none;
  }
}
.nav__list, .nav__list--mobile {
  display: flex;
  justify-content: end;
  gap: 2rem;
  box-sizing: border-box;
  margin: 0;
  padding: 0;
}
.nav__list--mobile {
  display: block;
  width: 100%;
}
.nav__item, .nav__item--mobile {
  list-style: none;
  text-align: center;
}
.nav__item--mobile {
  display: flex;
  align-items: center;
  justify-content: center;
}
.nav__link, .nav__link--mobile, .nav__link--mobile:hover, .nav__link--active, .nav__link:hover, .nav__link--active:hover {
  background-color: transparent;
  color: #9170f9;
  font-style: normal;
  font-weight: bold;
  min-width: 10%;
  box-sizing: border-box;
  height: 100%;
  padding: 1rem;
  display: flex;
  align-items: center;
}
@media (min-width: 768px) {
  .nav__link, .nav__link--mobile, .nav__link--mobile:hover, .nav__link--active, .nav__link:hover, .nav__link--active:hover {
    padding: 1.5rem;
  }
}
@media (min-width: 1280px) {
  .nav__link, .nav__link--mobile, .nav__link--mobile:hover, .nav__link--active, .nav__link:hover, .nav__link--active:hover {
    padding: 2rem;
  }
}
.nav__link--active, .nav__link:hover, .nav__link--mobile:hover, .nav__link--active:hover {
  border-bottom: #9170f9 solid 0.125rem;
}
.nav__link--mobile:hover {
  border: none;
  color: #ffffff;
}

.site-logo {
  aspect-ratio: 16/9;
  max-width: 10rem;
}

.hamburger {
  align-self: center;
  width: calc(100% - 10rem);
  display: flex;
  justify-content: end;
}
@media (min-width: 768px) {
  .hamburger {
    display: none;
  }
}
.hamburger__bar {
  display: block;
  width: 1.5625rem;
  height: 0.1875rem;
  margin: 0.3125rem auto;
  transition: all 0.3s ease-in-out;
  background-color: #6649f5;
  border-radius: 1rem;
}
.hamburger__bar-container.active .hamburger__bar:nth-child(2) {
  opacity: 0;
}
.hamburger__bar-container.active .hamburger__bar:nth-child(1) {
  transform: translateY(0.5rem) rotate(45deg);
}
.hamburger__bar-container.active .hamburger__bar:nth-child(3) {
  transform: translateY(-0.5rem) rotate(-45deg);
}

.hidden {
  display: none;
}

.color-text {
  color: #ffffff;
  font-style: italic;
}

.underline {
  text-decoration: underline;
  font-weight: bold;
  color: #c4acfd;
}

.credit-card {
  background: linear-gradient(135deg, #6649f5, #a384fa);
  backdrop-filter: blur(0.625rem);
  border-radius: 1rem;
  padding: 1rem;
  max-height: 20rem;
  aspect-ratio: 16/9;
  box-sizing: border-box;
  display: flex;
  flex-wrap: wrap;
}
@media (min-width: 0px) {
  .credit-card {
    width: calc(100vw - 2rem);
    max-width: fit-content;
    min-height: fit-content;
    max-height: 15rem;
  }
}
@media (min-width: 768px) {
  .credit-card {
    max-width: 28rem;
  }
}
.credit-card__chip {
  width: 3.125rem;
  margin: 0 auto 0 1rem;
}
@media (min-width: 0px) {
  .credit-card__chip {
    margin-left: 0;
    transform: scale(0.75);
  }
}
.credit-card__base-information {
  width: 100%;
  display: flex;
  flex-wrap: wrap;
}
.credit-card__title {
  width: 50%;
  text-align: start;
  font-size: 1.5rem;
}
@media (min-width: 0px) {
  .credit-card__title {
    margin: 0;
  }
}
.credit-card__bank {
  width: 50%;
  text-align: end;
  font-style: italic;
  font-size: 1.25rem;
}
@media (min-width: 0px) {
  .credit-card__bank {
    margin: 0;
  }
}
.credit-card__input {
  width: 80%;
  margin: 1rem auto 0;
  background-color: #6649f5;
  border: 0;
  outline: none;
  font-family: "DM Sans", sans-serif;
  color: #ffffff;
}
@media (min-width: 0px) {
  .credit-card__input {
    margin-top: 0;
  }
}
.credit-card__input::placeholder {
  font-family: "DM Sans", sans-serif;
  color: #ffffff;
}
.credit-card__placeholder-information {
  width: 100%;
  display: flex;
  justify-content: space-between;
  align-items: center;
}
.credit-card__valid-container {
  display: flex;
  width: 50%;
  justify-content: start;
  flex-wrap: wrap;
}
.credit-card__placeholder-title {
  margin-bottom: 0;
  font-size: 0.9rem;
  padding-right: 1rem;
}
@media (min-width: 0px) {
  .credit-card__placeholder-title {
    margin-top: 0;
  }
}
.credit-card__placeholder-text {
  margin-bottom: 0;
  font-size: 0.9rem;
}
.credit-card__placeholder-name {
  width: 100%;
  text-align: start;
  margin-top: 0;
  font-weight: bold;
  font-size: 0.9rem;
}
.credit-card__provider-image {
  width: 4.5rem;
  height: 4.5rem;
  color: red;
  background-position: center;
  background-size: contain;
  background-repeat: no-repeat;
}
@media (min-width: 0px) {
  .credit-card__provider-image {
    transform: scale(0.75);
  }
}

.credit-check {
  width: 100%;
  height: 100vh;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: start;
  padding-top: 1rem;
  gap: 1rem;
}
.credit-check__header {
  text-align: center;
}

.result-card {
  display: flex;
  align-items: center;
  justify-content: center;
  margin: 1rem;
  max-width: 27rem;
  width: 100%;
}
@media (min-width: 768px) {
  .result-card {
    max-width: 27rem;
  }
}
.result-card__container, .result-card__container--invalid, .result-card__container--valid {
  background-color: #211938;
  padding: 1rem;
  border-radius: 1rem;
  width: 100%;
}
.result-card__container--valid {
  background-color: #4caf50;
}
.result-card__container--invalid {
  background-color: #e91e63;
}
.result-card__text {
  text-align: center;
}

.information-card {
  max-width: 27rem;
  width: 100%;
  display: flex;
  align-items: center;
  justify-content: center;
}
.information-card__container {
  background-color: #372e4c;
  padding: 1rem;
  border-radius: 1rem;
  width: 100%;
}
.information-card__heading {
  margin-top: 0;
  text-align: center;
}
.information-card__subheading {
  font-weight: 600;
  font-style: italic;
}
.information-card__result {
  font-weight: 400;
  font-style: normal;
  color: #7d5df7;
}
